import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import LogoImg from './images/mylogo.svg';

// Rest of the code remains the same

const Navbar = () => {
    const [isMenuOpen, setMenuOpen] = useState(false);

    const openMenu = () => {
      setMenuOpen(true);
    };

    const closeMenu = () => {
      setMenuOpen(false);
    };

    return (
      <nav className="navbar">
        {/* Rest of the code remains the same */}

        <div className="links">
          <Link to="/">Home</Link>
          <div
            className="menu-dropdown"
            onMouseEnter={openMenu}
            onMouseLeave={closeMenu}
          >
            <Link to="/menu">Menu</Link>
            {isMenuOpen && (
              <div className="dropdown-content">
                <Link to="/menu/starters" onClick={closeMenu}>
                  Starters
                </Link>
                <Link to="/menu/platters" onClick={closeMenu}>
                  Platters
                </Link>
                <Link to="/menu/mains" onClick={closeMenu}>
                  Mains
                </Link>
                <Link to="/menu/drinks" onClick={closeMenu}>
                  Drinks
                </Link>
              </div>
            )}
          </div>
          <Link to="/reviewspage">Reviews</Link>
          <Link id="homeorderonline" to="/orderonlinepage">
            Order Online
          </Link>
          <Link id="homeorderonline" to="/book">
            Book Now
          </Link>
        </div>
      </nav>
    );
  };

  export default Navbar;
